theme_mods.custom_css_string:
/* header-logo-width 
=========================*/
.aux-logo-header .aux-logo-anchor{ max-width:90px; }
/* header-logo-max-height-type 
=========================*/
.aux-logo-header .aux-logo-anchor > img { max-height:85px; }
/* site-frame-background-color 
=========================*/
@media screen and (min-width: 700px) { .aux-framed .aux-side-frames, body.aux-framed:after,
            .aux-framed .aux-side-frames:before, .aux-framed .aux-side-frames:after{ background-color:#111111; } }
/* sticky-header-color 
=========================*/
.site-header-section.aux-sticky, .aux-elementor-header.aux-sticky { background-color:#FFFFFF; }
/* site-header-container-scaled-height 
=========================*/
.aux-top-sticky .site-header-section.aux-sticky .aux-fill .aux-menu-depth-0 > .aux-item-content, .aux-top-sticky .site-header-section.aux-sticky .aux-header-elements,.aux-elementor-header.aux-sticky { height:80px; }
/* site-header-container-height 
=========================*/
.site-header-section .aux-header-elements:not(.aux-vertical-menu-elements), .site-header-section .aux-fill .aux-menu-depth-0 > .aux-item-content { height:85px; }
/* site-transparent-header-bgcolor 
=========================*/
.site-header-section { background-color:#FFFFFF; }
/* site-vertical-menu-background-color 
=========================*/
.aux-vertical-menu-side  { background-color:#FFF; }
/* site-header-navigation-item-height 
=========================*/
.site-header-section .aux-middle .aux-menu-depth-0 > .aux-item-content { height:60px; }
/* site-mobile-header-toggle-button-color 
=========================*/
.site-header-section .aux-header .aux-burger:before, .site-header-section .aux-header .aux-burger:after, .site-header-section .aux-header .aux-burger .mid-line{ border-color:#3d3d3d; }
/* site-menu-full-screen-background-color 
=========================*/
#fs-menu-search:before { background-color:rgba(255, 255, 255, 0.95); }
/* site-top-header-background-color 
=========================*/
#top-header{background-color:#FFFFFF;}
/* blog-post-like-icon-size 
=========================*/
.single-post .wp_ulike_general_class button::before { font-size:10px; }
/* blog-post-share-button-icon-size 
=========================*/
.single-post .aux-single-post-share span::before { font-size:10px; }
/* post-title-bar-overlay-pattern-opacity 
=========================*/
.single-post .aux-overlay-bg-hash::before { opacity:0.15; }
/* page-title-bar-overlay-pattern-opacity 
=========================*/
.page .aux-overlay-bg-hash::before { opacity:0.5; }
/* product-single-wishlist-button-icon-size 
=========================*/
.single-product .auxshp-wishlist .auxshp-wishlist-icon::before { font-size:17px; }
/* product-single-share-button-icon-size 
=========================*/
.single-product .aux-share-btn span::before { font-size:17px; }
/* subfooter-bar-layout-bg-color 
=========================*/
.aux-subfooter-bar { background-color:#fafafa; }
/* subfooter-bar-top-border-color 
=========================*/
.aux-subfooter-bar { border-top:1px solid #EAEAEA; }
/* subfooter-layout-bg-image-position 
=========================*/
.aux-subfooter{background-position:center center;}
/* subfooter-layout-bg-image-size 
=========================*/
.aux-subfooter{background-size:cover;}
/* subfooter-layout-bg-image-repeat 
=========================*/
.aux-subfooter{background-repeat:no-repeat;}
/* subfooter-top-border-color 
=========================*/
.aux-subfooter { border-top:1px solid #EAEAEA; }
/* site-footer-bg-color 
=========================*/
.aux-site-footer{background-color:#1A1A1A;}
/* footer-top-border-color 
=========================*/
.aux-site-footer{border-top:1px solid #EAEAEA;}
/* footer-top-border-width 
=========================*/
.aux-site-footer { border-top-width:1px; }
/* site-secondary-logo-max-height 
=========================*/
.aux-logo-footer .aux-logo-anchor img { max-height:50px; }
/* product-title-bar-overlay-pattern-opacity 
=========================*/
.single-product .aux-overlay-bg-hash::before { opacity:0.5; }
/* site-featured-color-1 
=========================*/
:root{--auxin-featured-color-1: #000000;}
/* site-featured-color-2 
=========================*/
:root{--auxin-featured-color-2: #d10d43;}
/* site-featured-color-3 
=========================*/
:root{--auxin-featured-color-3: #ffffff;}
/* site-featured-color-4 
=========================*/
:root{--auxin-featured-color-4: rgba(0, 0, 0, 0.6);}
/* body-typography 
=========================*/
body{ font-family:'Montserrat'; } 
/* general-heading-h1 
=========================*/
body h1, body .aux-h1{ font-family:'Oswald'; } 
/* general-heading-h2 
=========================*/
body h2, body .aux-h2{ font-family:'Oswald'; } 
/* general-heading-h3 
=========================*/
body h3, body .aux-h3{ font-family:'Oswald'; } 
/* general-heading-h4 
=========================*/
body h4, body .aux-h4{ font-family:'Oswald'; } 
/* general-heading-h5 
=========================*/
body h5, body .aux-h5{ font-family:'Oswald'; } 
/* site-featured-color-5 
=========================*/
:root{--auxin-featured-color-5: #f5f5f5;}
/* page-title--typography 
=========================*/
.page-title{ color:rgb(0, 0, 0); font-size:45px; font-weight:bold; line-height:1.4em; } 
/* page-title-breadcrumb-typography 
=========================*/
.aux-breadcrumbs{ color:rgb(0, 0, 0); font-size:14px; font-weight:500; text-transform:uppercase; letter-spacing:3.5px; line-height:1.4em; } 
/* sidebar-common-widget-title-typography 
=========================*/
.aux-sidebar .widget-title{ color:rgb(0, 0, 0); font-size:20px; font-weight:800; line-height:1.4em; letter-spacing:-0.5px; } 
/* sidebar-global-typography 
=========================*/
.aux-sidebar{ color:rgba(0, 0, 0, 0); font-size:15px; font-weight:400; } 
/* product-setting-section-shop-page-bread-typo 
=========================*/
.woocommerce-page .aux-breadcrumbs > span, .woocommerce-page .aux-breadcrumbs > span a{ color:rgb(7, 8, 12); font-size:15px; font-weight:500; letter-spacing:0.2em; line-height:1.4em; } 
/* product-setting-section-shop-page-product-price-typo 
=========================*/
.aux-shop-archive .products-loop .price .amount, .aux-shop-archive .products-loop .price ins .amount{ color:rgb(0, 0, 0); font-size:20px; font-weight:600; line-height:1.3em; } 
/* product-setting-section-shop-page-product-reg-price-typo 
=========================*/
.aux-shop-archive .products-loop .price del,  .aux-shop-archive .products-loop .price del .amount{ color:rgba(0, 0, 0, 0.39); font-size:16px; } 
/* product-setting-section-shop-page-sales-badge-typo 
=========================*/
.aux-shop-archive .products-loop .onsale{ color:rgb(255, 255, 255); font-size:12px; font-weight:500; line-height:4.2em; letter-spacing:-0.1em; } 
/* page-subtitle--typography 
=========================*/
.page-title-section .page-subtitle{ font-size:14px; } 
/* product-setting-section-shop-page-product-title-typo 
=========================*/
.aux-shop-archive .products-loop .auxshp-loop-title{ color:rgb(7, 8, 12); font-size:25px; font-weight:bold; text-transform:uppercase; line-height:1.3em; } 
/* product-setting-section-single-appearance-add-to-btn 
=========================*/
.single-product .cart .auxshp-add-to-cart{ color:rgb(255, 255, 255); font-size:15px; font-weight:500; line-height:1.4em; letter-spacing:3.75px; } 
@media(max-width: 1024px){ .single-product .cart .auxshp-add-to-cart{ font-size:13px; }  } 
/* product-setting-section-shop-page-result-typo 
=========================*/
.woocommerce-page .woocommerce-result-count{ font-family:'Oswald'; color:rgb(0, 0, 0); font-size:20px; font-weight:800; line-height:1.3em; } 
/* product-setting-section-single-appearance-title 
=========================*/
.single-product .entry-title{ color:rgb(0, 0, 0); font-size:35px; font-weight:bold; line-height:1.4em; letter-spacing:-0.7px; } 
@media(max-width: 1024px){ .single-product .entry-title{ font-size:34px; }  } 
/* product-setting-section-single-appearance-price 
=========================*/
.single-product .price .amount, .single-product .price ins .amount{ color:rgb(0, 0, 0); font-size:35px; font-weight:bold; line-height:1.4em; letter-spacing:-1.05px; } 
@media(max-width: 1024px){ .single-product .price .amount, .single-product .price ins .amount{ font-size:28px; }  } 
/* product-setting-section-single-appearance-star-text 
=========================*/
.single-product .woocommerce-review-link{ color:rgb(0, 0, 0); font-size:15px; font-weight:400; line-height:1.4em; letter-spacing:2.25px; } 
/* product-setting-section-single-appearance-description 
=========================*/
.single-product .woocommerce-product-details__short-description{ color:rgb(0, 0, 0); font-size:15px; font-weight:400; line-height:1.7em; letter-spacing:2.25px; } 
@media(max-width: 1024px){ .single-product .woocommerce-product-details__short-description{ font-size:14px; }  } 
/* product-setting-section-single-appearance-category 
=========================*/
.single-product .auxshp-cats-wrapper .auxshp-label{ font-size:16px; font-weight:400; color:rgb(0, 0, 0); line-height:1.3em; letter-spacing:0.2em; text-transform:uppercase; } 
/* product-setting-section-single-appearance-category-terms 
=========================*/
.single-product .auxshp-cats-wrapper .auxshp-meta-terms, .single-product .auxshp-cats-wrapper .auxshp-meta-terms a{ color:rgb(209, 13, 67); font-size:16px; font-weight:400; line-height:1.3em; letter-spacing:0.2em; } 
/* product-setting-section-single-appearance-tabs-title 
=========================*/
.woocommerce-page .woocommerce-tabs .tabs li a{ color:rgba(0, 0, 0, 0.6); font-size:16px; font-weight:500; text-transform:uppercase; line-height:1.3em; letter-spacing:4px; } 
@media(max-width: 1024px){ .woocommerce-page .woocommerce-tabs .tabs li a{ font-size:14px; }  } 
/* product-single-share-button-margin 
=========================*/
.single-product .aux-share-btn .aux-icon{ margin: 0px 0px 0px -10px } 
/* product-single-wishlist-button-margin 
=========================*/
.single-product .auxshp-wishlist .auxshp-wishlist-icon{ margin: 0px 0px 0px 0px !important } 
/* product-setting-section-single-appearance-reg-price 
=========================*/
.single-product .price del .amount, .single-product .price del{ font-size:21px; color:rgb(184, 184, 184); font-weight:500; line-height:1.3em; } 
/* product-related-posts-label-typo 
=========================*/
.single-product .auxshp-related-products .widget-title{ color:rgb(7, 8, 12); font-size:40px; font-weight:bold; text-transform:capitalize; line-height:1.5em; } 
/* product-related-posts-title-typo 
=========================*/
.aux-widget-related-products .auxshp-entry-main .auxshp-loop-title{ color:rgb(7, 8, 12); font-size:25px; font-weight:bold; text-transform:capitalize; line-height:1.4em; } 
/* product-related-posts-price-typo 
=========================*/
.aux-widget-related-products .auxshp-entry-main .price .amount , .aux-widget-related-products .auxshp-entry-main .price ins .amount{ color:rgb(0, 0, 0); font-size:20px; font-weight:600; line-height:1.3em; } 
/* product-related-posts-reg-price-typo 
=========================*/
.aux-widget-related-products .auxshp-entry-main .price ins del,  .aux-widget-related-products .auxshp-entry-main .price del .amount{ color:rgba(0, 0, 0, 0.5); font-size:16px; font-weight:500; line-height:1.4em; } 
/* comment-forms-label-typo 
=========================*/
#commentform label{ color:rgba(0, 0, 0, 0.6); font-size:15px; font-weight:400; text-transform:uppercase; line-height:1.25em; letter-spacing:0.2em; } 
/* comment-forms-notes-typo 
=========================*/
#commentform .comment-notes{ color:rgba(0, 0, 0, 0.5); font-size:15px; font-weight:400; line-height:1.4em; letter-spacing:2.25px; } 
/* comment-forms-response-title-typo 
=========================*/
.comments-title, .comment-reply-title{ font-family:'Oswald'; color:rgb(0, 0, 0); font-size:30px; font-weight:bold; text-transform:uppercase; line-height:1.4em; } 
/* comment-forms-button-typo 
=========================*/
#commentform .form-submit input[type="submit"]{ color:rgb(255, 255, 255); font-size:12px; font-weight:500; line-height:1.3em; letter-spacing:3px; } 
/* product-setting-section-single-appearance-review-content 
=========================*/
.single-product .woocommerce-Reviews .comment-text{ font-weight:500; font-size:15px; letter-spacing:1.5px; line-height:1.5em; color:rgba(32, 36, 46, 0.8); text-transform:capitalize; font-family:'Montserrat'; } 
/* product-setting-section-single-appearance-review-author 
=========================*/
.single-product .woocommerce-review__author{ font-family:'Oswald'; color:rgb(0, 0, 0); font-size:16px; font-weight:bold; text-transform:uppercase; line-height:1.4em; letter-spacing:-0.3px; } 
/* product-setting-section-single-appearance-review-date 
=========================*/
.single-product .woocommerce-review__published-date{ color:rgb(133, 137, 151); font-size:15px; font-weight:400; line-height:1.5em; letter-spacing:3.75px; } 
/* product-setting-section-single-appearance-review-title 
=========================*/
.single-product .woocommerce-Reviews-title{ font-family:'Oswald'; color:rgb(0, 0, 0); font-size:30px; font-weight:bold; text-transform:uppercase; line-height:1.4em; } 
/* single-post-title-typography 
=========================*/
.single-post .aux-primary .hentry .entry-title{ color:rgb(0, 0, 0); font-size:35px; font-weight:bold; line-height:1.4em; } 
/* single-post-content-typography 
=========================*/
.single-post .hentry .entry-content{ color:rgb(0, 0, 0); font-size:16px; font-weight:500; line-height:1.6em; } 
/* single-post-info-typography 
=========================*/
.single-post .hentry .entry-info{ color:rgb(0, 0, 0); font-size:15px; font-weight:400; text-transform:uppercase; line-height:1.3em; letter-spacing:3.37px; } 
@media(max-width: 768px){ .single-post .hentry .entry-info{ font-size:12px; }  } 
/* single-post-info-terms-typography 
=========================*/
.single-post .hentry .entry-info a{ color:rgb(0, 0, 0); font-size:14px; font-weight:400; text-transform:uppercase; letter-spacing:3.37px; } 
@media(max-width: 768px){ .single-post .hentry .entry-info a{ font-size:12px; }  } 
/* product-setting-section-single-appearance-tabs-content 
=========================*/
.single-product .woocommerce-tabs .tabs-content{ font-weight:400; font-size:16px; color:rgba(32, 36, 46, 0.8); }

